    "rice-lake-national-wildlife-refuge-narrative-report-may-june-july-august-1945",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Rice Lake NWR
    outlines Refuge accomplishments from May through August of 1945. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, mammals, raptors, and fish- is also covered. The Refuge development and
    maintenance section discusses physical developments and plantings. Resource management
    is outlined; topics include haying, fur harvesting, and timber removal. The public
    relations section of the report describes Refuge visitors and Refuge participation.
    N-R forms and photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
